import logo from './logo.svg';
import './App.css';

function App() {
  let urlItems = ["URL1", "URL2", "URL3"];
  let requests = ["request1", "request2", "request3"];
  let requestInfo = ["info 1", "info 2", "info 3"];
  return (
    <div>

        <p>Hello initial world</p>
      <div class="row">
        <div className="column"><UrlList urls={urlItems} /></div>
        <div className="column"><RequestList requests={requests} /></div>
        <div className="column"><RequestBody body={requestInfo}/></div>
      </div>



    </div>
  );
}

const UrlList = (props) => {
  return (<div>
    <p>List for URLs</p>
    <ul>
      {props.urls.map(function(name, index) {
        return <UrlItem name={name} index={index} />
      })}
    </ul>
    </div>); // Iterate through array of URL items, display key components of each one 
}

function UrlItem(props) {
  return (<li index={props.index}>
    {props.name}
    </li>); // Display each url item
}

function RequestList(props) {
  return (<div>
    <p>List for Requests</p>
    <ul>
      {props.requests.map(function(name, index) {
        return <RequestItem name={name} index={index} />
      })}
    </ul>
    </div>); // Iterate through array of request items, display key components of each one 
}

function RequestItem(props) {
  return (<li index={props.index}>
    {props.name}
    </li>); // Display each request item
}

function RequestBody(props) {
  return (<div>Body of single request</div>); // display body of request 
}

export default App;
